import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LandingPage from './LandingPage';
import DashboardLayout from './DashboardLayout'; // New layout component
import QuarterlyDashboard from './components/QuarterlyDashboard';
import AIDashboard from './components/AILandingPage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route element={<DashboardLayout />}> {/* Wrapper for all dashboard pages */}
          <Route path="/dashboard" element={<QuarterlyDashboard />} />
          <Route path="/dashboard/ask-ai" element={<AI />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
